<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <title>Index - webstatic.aquanir.cc</title>
</head>

<body>
  <!-- jump to homepage -->
  <script>
    function jumpUrl() {
      var arr = new Array(
        "https://aquanir.cc",
      );
      window.location.href = arr[Math.floor(Math.random() * arr.length)];
    }

    setTimeout(function () {
      jumpUrl();
    }, 10);//设定跳转时间，1s=1000
  </script>
